Event timestamps are always calculated relative to the first event in a ping. The first event will always have timestamp 0 and subsequent events will have timestamps corresponding to the elapsed amount of milliseconds since that first event. That is also the case for events recorded throughout restarts. Example In the below example payload, there were two events recorded on the first application run. The first event is timestamp 0 and the second event happens one second after the first one, so it has timestamp 1000. The application is restarted one hour after the first event and a glean.restarted event is recorded, timestamp 3600000. Finally, an event is recorded during the second application run two seconds after restart, timestamp 3800000. { ... "events": [ { "timestamp": 0, "category": "examples", "name": "event_example", }, { "timestamp": 1000, "category": "examples", "name": "event_example" }, { "timestamp": 3600000, "category": "glean", "name": "restarted" }, { "timestamp": 3800000, "category": "examples", "name": "event_example" }, ]
} Caveat: Handling decreasing time offsets For events recorded in a single application run, Glean relies on a monotonically increasing timer to calculate event timestamps, while for calculating the time elapsed between application runs Glean has to rely on the computer clock, which is not necessarily monotonically increasing. In the case that timestamps in between application runs are not monotonically increasing, Glean will take the value of the previous timestamp and add one millisecond, thus guaranteeing that timestamps are always increasing. Checking for decreasing time offsets between restarts When this edge case is hit, Glean records an InvalidValue error for the glean.restarted metric. This metric may be consulted at analysis time. It is sent in the same ping where the error happened. In the below example payload, the first and second application runs go exactly like in the example above . The only difference is that when the restart happens, the offset between the absolute time of the first event and the absolute time of the restart is not enough to keep the timestamps increasing. That may happen for many reasons, such as a change in timezones or simply a manual change in the clock by the user. In this case, Glean will ignore the incorrect timestamp and add one millisecond to the last timestamp of the previous run, in order to keep the monotonically increasing nature of the timestamps. { ... "events": [ { "timestamp": 0, "category": "examples", "name": "event_example", }, { "timestamp": 1000, "category": "examples", "name": "event_example" }, { "timestamp": 1001, "category": "glean", "name": "restarted" }, { "timestamp": 3001, "category": "examples", "name": "event_example" }, ]
} Found a bug? Edit this file on GitHub.

