In order for the Glean Kotlin SDK to generate an API for your metrics, two Gradle plugins must be included in your build: The Glean Gradle plugin JetBrains' Python envs plugin The Glean Gradle plugin is distributed through Mozilla's Maven, so we need to tell your build where to look for it by adding the following to the top of your build.gradle: buildscript { repositories { // Include the next clause if you are tracking snapshots of android components maven { url "https://snapshots.maven.mozilla.org/maven2" } maven { url "https://maven.mozilla.org/maven2" } dependencies { classpath "org.mozilla.components:tooling-glean-gradle:{android-components-version}" } }
} Important As above, the {android-components-version} placeholder in the above link should be replaced with the version number of android components used in your project. The JetBrains Python plugin is distributed in the Gradle plugin repository, so it can be included with: plugins { id "com.jetbrains.python.envs" version "0.0.26"
} Right before the end of the same file, we need to apply the Glean Gradle plugin. Set any additional parameters to control the behavior of the Glean Gradle plugin before calling apply plugin. // Optionally, set any parameters to send to the plugin.
ext.gleanGenerateMarkdownDocs = true
apply plugin: "org.mozilla.telemetry.glean-gradle-plugin" Earlier versions Note: Earlier versions of Glean used a Gradle script (sdk_generator.gradle) rather than a Gradle plugin. Its use is deprecated and projects should be updated to use the Gradle plugin as described above. Offline builds The Glean Gradle plugin has limited support for offline builds of applications that use the Glean SDK. Found a bug? Edit this file on GitHub.

