The Glean JavaScript SDK is distributed as an npm package @mozilla/glean . This package has different entry points to access the different SDKs. @mozilla/glean/web gives access to the websites SDK @mozilla/glean/webext gives access to the web extension SDK @mozilla/glean/node gives access to the Node.js SDK [1] The Node.js SDK does not have persistent storage yet. This means, Glean does not persist state throughout application runs. For updates on the implementation of this feature in Node.js, follow Bug 1728807 . Install Glean in your JavaScript project, by running: npm install @mozilla/glean Then import Glean into your project: // Importing the Glean JavaScript SDK for use in **web extensions**
//
// esm
import Glean from "@mozilla/glean/webext";
// cjs
const { default: Glean } = require("@mozilla/glean/webext"); // Importing the Glean JavaScript SDK for use in **websites**
//
// esm
import Glean from "@mozilla/glean/web";
// cjs
const { default: Glean } = require("@mozilla/glean/web"); // Importing the Glean JavaScript SDK for use in **Node.js**
//
// esm
import Glean from "@mozilla/glean/node";
// cjs
const { default: Glean } = require("@mozilla/glean/node");

