Define the custom ping that will help control the upload scheduling by creating a pings.yaml file in the same directory as the metrics.yaml file. For more information about adding custom pings, see the section on custom pings . The name of the ping will be crash, so the pings.yaml file should look like this: # Required to indicate this is a `pings.yaml` file
$schema: moz://mozilla.org/schemas/glean/pings/2-0-0 crash: description: > A ping to transport crash data include_client_id: true notification_emails: - crash@example.com bugs: - https://bugzilla.mozilla.org/show_bug.cgi?id=1582479 data_reviews: - https://bugzilla.mozilla.org/show_bug.cgi?id=1582479 Before the newly defined metric or ping can be used, the application must first be built. This will cause the glean_parser to execute and generate the API files that represent the metric and ping that were newly defined. Note: If changes to the YAML files aren't showing up in the project, try running the clean task on the project before building any time one of the Glean YAML files has been modified. It is recommended that Glean be initialized as early in the application startup as possible, which is why it's good to use a custom Application, like the Glean Sample App GleanApplication.kt . Initializing Glean in the Application.onCreate() is ideal for this purpose. Start by adding the import statement to allow the usage of the custom ping that was created, adding the following to the top of the file: import org.mozilla.gleancrashexample.GleanMetrics.Pings Next, register the custom ping by calling Glean.registerPings(Pings) in the onCreate() function, preferably before calling Glean.initialize(). The completed function should look something like this: override fun onCreate() { super.onCreate() // Register the application's custom pings. Glean.registerPings(Pings) // Initialize the Glean library Glean.initialize(applicationContext)
} This completes the registration of the custom ping with the Glean Kotlin SDK so that it knows about it and can manage the storage and other important details of it like sending it when send() is called.

